import React from 'react';
import { CardContent } from '../../atoms';
import { StatsItem } from '../StatsItem';

const StatsList = (props) => {
    const { stats } = props;
    return (

        <CardContent>
            {stats.map((item, idx) => (
                <StatsItem key={idx} name={item.stat.name} value={item.base_stat}/>
            ))}
        </CardContent>
    )
}

export default StatsList;
